import { useEffect, useState } from "react";
import { couponApi } from "@api";
import { CouponList } from "@components";
import { ICoupon } from "@interfaces";

export const ModulesCoupon = () => {
    //page state
    const [coupons, setCoupon] = useState<ICoupon>();

    useEffect(() => {
        (async () => {
            const res = await couponApi.getListCoupon();
            const data = res.data as ICoupon;
            setCoupon(data);
        })();
    }, []);
    return <>{coupons && <CouponList />}</>;
};
